import React from 'react';
import './stylesheets/App.css';
import Curve from "./Curve";

let curves = [];
let k = 0;

class App extends React.Component {
	render(){
    	return (<div>
    				<p>{k}</p>
    				<div>{[...curves]}</div><br/>
    				<button onclick={k++}> Add Curve</button> 
    			</div>);
  }  
}

export default App;
